CREATE OR REPLACE PROCEDURE RM558024.PRC_INSERE_MOV(
  p_id_agencia IN NUMBER,
  p_id_conta   IN NUMBER,
  p_valor      IN NUMBER
) IS
BEGIN
  IF FUN_VALIDA_VALOR(p_valor) = 1 THEN
    INSERT INTO FATO_MOVIMENTO (id_agencia, id_conta, valor)
    VALUES (p_id_agencia, p_id_conta, p_valor);
  END IF;
END;
